    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + 42 * - col1 NOT IN ( + col2 * - col1, - 94 * col2 + + - col1, - - col2 );
  - name: tab2

outputs:
  - name: q9521.out
    data: |
      46	51	23
      64	77	40
      75	67	58
